	if (_parent._parent._name == _root.控制目标)
	{_parent.连环踢可派生搓招();}
}

onClipEvent(load){
   if(_root.是否阴影 == true)
   {
      this._visible = 1;
   }
   else
   {
      this._visible = 0;
   }
}
